import React from 'react'
import { withOktaAuth } from "@okta/okta-react";

export default withOktaAuth(class Profile extends React.Component{

    async logout() {
        this.props.oktaAuth.signOut('/');
    }

    render() {
        return(
            <div>
                <h3>Your Profile</h3>
                <div>Username</div>
                <div>EMail </div>
                <button onClick={this.logout}>Logout</button>
            </div>
        )
    }
})
